@Yee Lee Haw The problem I have with this is that even if you have an AI that can outcode an engineer, it will still need a guide with enough technical knowledge and understanding of the architecture being built to guide it. 

Computers do what they're told, and if someone who lacks architectural knowledge instructs an AI to inadvertently overwrite some essential part of a legacy system, for example, it will do so. This is why engineers will still be necessary, although they will take on a role more as architects or overseers in the near future and will communicate with computers not with code but with natural language defining very specific parameters.

Eventually, though, I do agree that AI will be able to "think" like humans and fully replace engineers, but I think there will be a lot of bottlenecks in place before we get there. Remember, GPT still uses transformers, which are ML models that are almost 5 years old. Tech-wise, this is ancient, but we haven't come up with anything better yet. There's going to have to be a lot more innovations and breakthroughs before we get anywhere near singularity and most of those breakthroughs are going to be human-dependent...which means it's going to take some time.

