@MagmaSloth64 Yeah, I concur with the analogies you use. That being said we need to be careful about the disruptions inventions like this make, and I am glad people smarter and more ethical than I am are working on it (at least, this is the perception I have of the situation) at the companies which are advancing AI. Some of these include how the availability of such free and easy to generate information, data, code and more can be dangerous to all sorts of people.

If I had to hazard a guess - we would need even more 'verifiers', 'testers' and auditors who can efficiently parse this level of information being produced and protect their communities or stakeholders from its negative net outcomes. Possibly roles like "Senior Fact Checkers" or "Data Verification Specialist" or "Provenance govenors" might become very real job titles beyond any niche way they're employed currently. And these won't just be people who tick a checkbox, but can act almost like forensic scientists in determining if some data is false, or AI generated or is likely to mislead.

Until we can get an AI to demonstrate any sort of imperative, independent force of will which arises as some emergent property from its massive array of 1s and 0s, I don't believe that the AI is the problem. It is the will of a human being or beings who will drive the use of the tool to positive or negative outcomes.

