@Met. This doesnt take programmers completely out of the loop, at least not yet, but I really dont think it ever will. This is still a tool -- an incredibly advanced tool no doubt, but let me give you something to think about: imagine you transported back to 1940 or 1950 or whatever, when people were only coding in assembly, and it took 100 coders working on some project a year to produce some super basic application/algorithm. Then you show them modern frameworks/compilers and they're blown away and freaking out -- "were all going to lose our jobs, 1 person in a week can produce more code than 100 of us in a year!" they say. 

And then you tell them the tech industry actually employs millions of people, is many orders of magnitude larger than it is for them, and yet it still has far more demand for workers/jobs than there are programmers.. they wouldnt even be able to conceive of that scenario. The point is, sure, writing code is far, far easier, faster, more efficient, etc. now than it was in the 40s/50s, and yes a coder today is far more productive than a coder from 1950, maybe several orders of magnitude more productive even, but that hasnt dampened demand for coders. Applications are unbelievably more complex than they were 75 years ago (many orders of magnitude), we have websites and applications with millions, or tens of millions of lines of code, something that simply wasnt fathomable 75 years ago. 

I really dont think if chatGPT makes coders say an order of magnitude more productive, that it implies 90% of coders are going to get laid off -- what I think it means is coders will be asked to do is produce an order of magnitude more code/more complex code. There are going to be revolutionary, transformative, mind-blowing applications that just arent realistic/possible right now that will become possible if coders get an order of magnitude (or more) more productive.

